import React, { Component } from 'react';
import Card from "./serviceCard"


export default class homePageOld extends Component {




    render() {
        return (
            <div>
                <section class="title">
                    <div class="col-md-6 titletext">
                        <h1>Helping farmers to effectively plant the right crops in the right place and weather</h1>
                        <button type="button" class="btn btn-dark btn-lg googlebtn"
                            onclick="location.href='https://play.google.com/store/apps/details?id=com.coakum.agrolly'"><i
                                class="fab fa-google-play"></i> Download</button>
                        <button type="button" class="btn btn-dark btn-lg googlebtn"
                            onclick="location.href='https://www.youtube.com/watch?v=VT4RKHwQ1hQ&feature=youtu.be'"><i class="fas fa-film"></i> Video</button>
                    </div>
                    <div>
                        <img class="cellphoneimg" src="image/phoneimg.png" alt="our app"></img>
                    </div>
                </section>
            </div>
        )
    }
}
